CREATE DEFINER=`root`@`localhost` PROCEDURE `guia_search`(

IN inputText varchar(300),
IN inputText2 varchar(300),
IN b INT

)
BEGIN
SET NAMES 'utf8';

IF b = 0 THEN
SELECT CASE SUBSTRING(interno, 1, 2) WHEN '13' THEN '431' WHEN '60' THEN '*' ELSE '425' END AS FIELD1,interno, usuario,dependencia,NombreCompleto,personas
from internos,departamentos where internos.deptoId=departamentos.id_depto 
and (interno LIKE CONCAT('%',inputText,'%')
	or usuario LIKE CONCAT('%',inputText,'%') or usuario like CONCAT('%',inputText2,'%')
	or NombreCompleto like CONCAT('%',inputText,'%') or NombreCompleto like CONCAT('%',inputText2,'%')
	or dependencia like CONCAT('%',inputText,'%') COLLATE utf8_spanish_ci or dependencia like CONCAT('%',inputText2,'%')
	or personas like CONCAT('%',inputText,'%') or personas like CONCAT('%',inputText2,'%'))
	and interno NOT LIKE '7%'  
    group by interno,usuario  order by departamentos.depto asc ,usuario asc; 
END IF;
IF b = 1 THEN
	SELECT CASE SUBSTRING(interno, 1, 2) WHEN '13' THEN '431' WHEN '60' THEN '*' ELSE '425' END AS FIELD1,interno, usuario,dependencia,NombreCompleto,personas
	from internos,departamentos where internos.deptoId=departamentos.id_depto 
	AND
	(NombreCompleto like CONCAT('%',inputText,'%') or NombreCompleto like CONCAT('%',inputText2,'%'))
	and interno NOT LIKE '7%'  
group by interno,usuario  order by departamentos.depto asc ,usuario asc; 
END IF;
END ;;
